function Button() {
  return (
    <div className="buttonOuter">
      <style jsx>{`
        .buttonOuter {
          padding: 10px;
          width: 150px;
          height: 125px;
          background-color: #B775E0;
          box-shadow: 0px 4px 0px #9F0B37;
          border-radius: 20px;
          display: inline-block;
          color: white;
          font-size: 20px;
          font-weight: 600;
        }
      `}</style>
    </div>
  )
}

export default Button
